"header\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-09-08 09:02:45\"\n    },\n    \"business-contra::business_contra_show_quote\": {\n        \"value\": \"no\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2019-09-08 09:02:45\"\n    }\n}','','','trash','closed','closed','','d8b6c0d8-6126-49fc-9dad-4acc924d496e','','','2019-09-08 09:02:45','2019-09-08 09:02:45','',0,'http://localhost/wordtest/index.php/2019/09/08/d8b6c0d8-6126-49fc-9dad-4acc924d496e/',0,'customize_changeset','',0),(43,1,'2019-09-08 09:03:12','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2019-09-08 09:03:12','0000-00-00 00:00:00','',0,'http://localhost/wordtest/?p=43',0,'post','',0),(44,1,'2019-09-08 09:04:15','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2019-09-08 09:04:15','0000-00-00 00:00:00','',0,'http://localhost/wordtest/?p=44',0,'post','',0),(45,1,'2019-09-08 09:09:49','2019-09-08 09:09:49','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wordtest/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2019-09-08 09:09:49','2019-09-08 09:09:49','',2,'http://localhost/wordtest/index.php/2019/09/08/2-revision-v1/',0,'revision','',0),(46,1,'2019-09-08 09:09:53','2019-09-08 09:09:53','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://localhost/wordtest.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','inherit','closed','closed','','3-revision-v1','','','2019-09-08 09:09:53','2019-09-08 09:09:53','',3,'http://localhost/wordtest/index.php/2019/09/08/3-revision-v1/',0,'revision','',0),(47,1,'2019-09-08 09:10:14','2019-09-08 09:10:14','','About','','publish','closed','closed','','about','','','2019-09-08 09:10:14','2019-09-08 09:10:14','',0,'http://localhost/wordtest/?page_id=47',0,'page','',0),(48,1,'2019-09-08 09:10:14','2019-09-08 09:10:14','','About','','inherit','closed','closed','','47-revision-v1','','','2019-09-08 09:10:14','2019-09-08 09:10:14','',47,'http://localhost/wordtest/index.php/2019/09/08/47-revision-v1/',0,'revision','',0),(49,1,'2019-09-08 09:10:55','2019-09-08 09:10:55','','Categories','','trash','closed','closed','','categories__trashed','','','2019-09-08 12:24:42','2019-09-08 12:24:42','',0,'http://localhost/wordtest/?page_id=49',0,'page','',0),(50,1,'2019-09-08 09:10:55','2019-09-08 09:10:55','','Categories','','inherit','closed','closed','','49-revision-v1','','','2019-09-08 09:10:55','2019-09-08 09:10:55','',49,'http://localhost/wordtest/index.php/2019/09/08/49-revision-v1/',0,'revision','',0),(52,1,'2019-09-08 09:11:54','2019-09-08 09:11:54',' ','','','publish','closed','closed','','52','','','2019-09-08 12:25:39','2019-09-08 12:25:39','',0,'http://localhost/wordtest/?p=52',2,'nav_menu_item','',0),(53,1,'2019-09-08 09:11:11','0000-00-00 00:00:00',' ','','','draft','closed','closed','','','','','2019-09-08 09:11:11','0000-00-00 00:00:00','',0,'http://localhost/wordtest/?p=53',1,'nav_menu_item','',0),(54,1,'2019-09-08 09:13:14','2019-09-08 09:13:14','','Home','','trash','closed','closed','','home__trashed','','','2019-09-08 09:17:48','2019-09-08 09:17:48','',0,'http://localhost/wordtest/?page_id=54',0,'page','',0),(55,1,'2019-09-08 09:13:14','2019-09-08 09:13:14','','Home','','inherit','closed','closed','','54-revision-v1','','','2019-09-08 09